private static <V> V getChecked(Future<V> future) throws YarnException {
  try {
    return future.get();
  } catch (InterruptedException e) {
    Thread.currentThread().interrupt();
    throw new YarnException(e);
  } catch (ExecutionException e) {
    throw new YarnException(e);
  }
}
